import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { Typography, Paper } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    height: '100vh',
    background: '#f0f0f0',
  },
  paper: {
    padding: theme.spacing(3),
    maxWidth: 600,
    width: '100%',
    borderRadius: 8,
    boxShadow: '0px 0px 20px rgba(0, 0, 0, 0.1)',
  },
  header: {
    fontSize: 36,
    fontWeight: 'bold',
    marginBottom: theme.spacing(2),
    color: '#333333',
    textAlign: 'center',
  },
  text: {
    fontSize: 16,
    marginBottom: theme.spacing(2),
    color: '#555555',
    textAlign: 'center',
  },
}));

function App() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Paper className={classes.paper}>
        <Typography className={classes.header}>
          My Portfolio
        </Typography>
        <Typography className={classes.text}>
          Welcome to my portfolio! This is a sample webpage built using React and Material UI.
        </Typography>
        <Typography className={classes.text}>
          Here you can showcase your projects, skills, and other relevant information to potential employers and clients.
        </Typography>
      </Paper>
    </div>
  );
}

export default App;
